import React, { useState, useEffect } from "react";
import Events from "./Events";
// import { NavLink } from "react-router-dom";
import News from "./News";
import Button from "react-bootstrap/Button";
import Card from "./Card";
import Jobs from "./Jobs";

function Home() {
  return (
    <div className="d-flex flex-column align-items-center">
      <div className="d-flex flex-row col-11 col-md-9" style={{ height: "85vh" }}>
        <div className="d-none d-md-block col-sm-4" style={{ height: "300px", padding: "1rem" }}>
          <Events />
        </div>
        <div className="col-11 col-md-8 d-flex flex-column align-items-center justify-content-center" style={{ height: "250px", padding: "1rem", textAlign: "center" }}>
          <h3>Discover what you are looking for by searching blog posts...</h3>
        </div>
      </div>
      <div className="mt-auto">Recent Posts</div>
      <div className="d-none d-md-block col-sm-3" style={{ height: "85vh", padding: "1rem" }}>
        <News />
        <Jobs />
      </div>
    </div>
  );
}

export default Home;
